import React, { useState,useEffect, useRef } from 'react';
// import bg1 from "../../Assets/images/bg1.png"
import bg1 from "../../Assets/images/lines.mp4"

import bg2 from "../../Assets/images/circle.jpg"
import bg3 from "../../Assets/images/glass.jpg"
import Footer from '../common/footer'
import Header from '../common/header'



const Counter = ({ title, value, suffix }) => {
    const [count, setCount] = useState(0);
  
    useEffect(() => {
      let interval;
      if (count < value) {
        interval = setInterval(() => {
          setCount(prevCount => prevCount + 1);
        }, 50); // You can adjust the duration as needed
      }
      return () => {
        clearInterval(interval);
      };
    }, [count, value]);
  
    return (
        <div className="counter ">
        <span className="counter-number">{count}</span>
        {suffix && <span className="counter-suffix">{suffix}</span>}
        <div className="counter-title">{title}</div>
      </div>
    );
  };





const Home = () => {

    

  return (
<div className='bgnn' >


 <div class="uk-position-relative" style={{height:"704px" , marginBottom:""}} >
    
    <video class="uk-background-cover uk-position-absolute" src={bg1} loop muted playsinline autoplay uk-video="autoplay: inview"></video>

    
    <div className="uk-position-cover  ">
     <div className='uk-sticky' uk-sticky=" " >   
    <Header/>
    </div>
        <div className="uk-container uk-padding-large">
            <div style={{ width: "427px" }}>
                <h1 className="gh1 animated-text" style={{ color: 'darkgray', fontWeight: "700", fontSize: "57px", fontFamily: "Lexend Deca" }}>  Welcome <br></br> to the world of Social Pigeons </h1>
            </div>
            <div style={{ width: "444px" }}>
                <p className="greytext animated-text2" style={{ fontSize: "24px", fontWeight: "400" }}>Navigate your digital world with exceptional influencers and social media marketing.</p>
            </div>
        </div>
    </div>
</div>


 


<div   class="uk-position-relative uk-position-z-index-zero">
    <div style={{height:'100vh'}} class="  uk-background-cover uk-padding uk-flex uk-flex-center uk-flex-middle uk-text-center uk-light uk-height-medium uk-position-z-index-negative " data-src = "https://images.unsplash.com/photo-1490822180406-880c226c150b?fit=crop&w=650&h=433&q=80" uk-img = "loading : eager" uk-sticky="overflow-flip: true; end: 100%; offset: 100">
        overflow-flip: true<br/>
        end: 100%
    </div>



    <div style={{height:"100vh"}}>
<div style={{height:"150px", backgroundColor:'black'}} class=" uk-background-cover uk-overflow-hidden uk-light uk-flex">
    <div class="  uk-width-1-2@m uk-text-center uk-margin-auto uk-margin-auto-vertical">
        <h1 uk-parallax="opacity: 0,1,1; y: -100,0,0; x: 100,100,0; scale: 2,1,1; end: 50vh + 50%;">Headline</h1>
        <p uk-parallax="opacity: 0,1,1; y: 100,0,0; x: -100,-100,0; scale: 0.5,1,1; end: 50vh + 50%;">Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
    </div>
</div>
</div>




{/* COunt down */}
    
    <div class=" bgnn uk-background-cover uk-background-secondary uk-padding uk-flex uk-flex-center uk-flex-middle uk-text-center uk-light uk-height-medium uk-position-z-index-negative"  uk-sticky="position: bottom; overflow-flip: true; start: 100%; end: 0">
    <Counter title="Projects completed" value={150} suffix="+" />
      <Counter title="Happy clients" value={130} />
      <Counter title="Awards received" value={25} suffix="+" />
      <Counter title="Team members" value={40} />
    </div>
    <Footer/>





</div>
</div>
  )
}

export default Home
